func testSolutionToOneSetOpDuelUsingDuel(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a Solution
	var b, c Duel

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, solutionDBTypes, false, strmangle.SetComplement(solutionPrimaryKeyColumns, solutionColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &b, duelDBTypes, false, strmangle.SetComplement(duelPrimaryKeyColumns, duelColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &c, duelDBTypes, false, strmangle.SetComplement(duelPrimaryKeyColumns, duelColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	for i, x := range []*Duel{&b, &c} {
		err = a.SetDuel(ctx, tx, i != 0, x)
		if err != nil {
			t.Fatal(err)
		}

		if a.R.Duel != x {
			t.Error("relationship struct not set to correct value")
		}

		if x.R.Solutions[0] != &a {
			t.Error("failed to append to foreign relationship struct")
		}
		if !queries.Equal(a.DuelID, x.ID) {
			t.Error("foreign key was wrong value", a.DuelID)
		}

		zero := reflect.Zero(reflect.TypeOf(a.DuelID))
		reflect.Indirect(reflect.ValueOf(&a.DuelID)).Set(zero)

		if err = a.Reload(ctx, tx); err != nil {
			t.Fatal("failed to reload", err)
		}

		if !queries.Equal(a.DuelID, x.ID) {
			t.Error("foreign key was wrong value", a.DuelID, x.ID)
		}
	}
}

